import { useState } from "react";

const baseUrl = "https://localhost:44376/user/";

export const getUser = () => {
  var query = axios.get(baseUrl + "user");
  return query;
};

export const create = (newRecord) => {
  var query = axios.post(baseUrl + "user/add", newRecord);
  return query;
};

